import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Overview = () => {
  return (
    <div className='home'>
      <table class="table table-striped">
       <tr>
         <td>
           ID
         </td>
         <td>
           Mahsulot
         </td>
         <td>
           Narxi
         </td>
         <td>
           Amallar
         </td>
       </tr>
      </table>
    </div>
  );
};

export default Overview;
